import Dice from "./Dice";
import Button from "./Button";
import { useState } from "react";
function App() {
  const [num, setNum] = useState(1);

  const handleRollClick = () => {
    setNum(3);
  };
  return (
    <div>
      <Button onClick={handleRollClick}>던지기</Button>
      <Button>처음부터</Button>
      <Dice num={num} />
    </div>
  );
}

export default App;
